import React from "react";

const FormPost = (props) => {
  return (
    <article style={styles.article} key={props.id}>
      <img src={props.avatar} alt={props.alt} />
      <h3>{props.title}</h3>
      <p>{props.description}</p>
    </article>
  );
};

export default FormPost;

const styles = {
  article: {
    backgroundColor: "#ccc",
    padding: "2rem",
  },
};
